import { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { UserType, CompanyInfoType, HomeProps } from '../utils/types';
import { CompanyInfo } from '../../../backend/src/model/companyInfo';

function Home({ user, companyInfoList }: HomeProps) {
	const navigate = useNavigate();

	useEffect(() => {
		if (user.email !== '') {
			document.title = 'ホーム';
		} else {
			alert('ログインしてください');
			navigate('/pages/user/login');
		}
	});
	return (
		<div>
			<h2>{user.name}様</h2>
			<h3>登録企業</h3>
			<table>
				<thead>
					<tr>
						<th>Header 1</th>
						<th>Header 2</th>
					</tr>
				</thead>
				<tbody>
					{companyInfoList.map((companyInfo, index) => (
						<tr key={index}>
							<td>{companyInfo.id}</td>
							<td>{companyInfo.memo}</td>
						</tr>
					))}
				</tbody>
			</table>
		</div>
	);
}

export default Home;
